const block2 = (item, index, context) => { return html`<li class="ui5-wheelslider-item" data-item-index="${index}">${ifDefined(item)}</li>					`; };
const block3 = (context) => { return html`<ul id="${ifDefined(context._id)}--items-list"><li class="ui5-wheelslider-item">${ifDefined(context.value)}</li></ul>			`; };

